import React from 'react';
import styled from "styled-components";

export const SiteTitle = styled.div`
  padding: 40px;
	font-size: 48px;
`
const MovieListHeading = (props) => {
	return (
		<div className='col'>
			<h1>{props.heading}</h1>
		</div>
	);
};

export default MovieListHeading;
